font-size: 4.5vw;
color:purple;
margin-left:25%;
padding: 0% 5% ;
padding-bottom: 20px;
`;
const News = Styled.p`
font-size: 1.5vw;
color:palevioletred;
position:absolute;
`;
export default NewsTicker
